import React from "react";

const Main = () => {
  return (
    <div>
      <h1>
        We are
        <br />
        Creative
        <br /> Agency
      </h1>
      <p>Working with brands all over the world</p>
      <img src="./images/CartoonMac" alt="" />
    </div>
  );
};

export default Main;
